var script_f23_31_24049=[" ",
"",
"",
"function log(i){",
"return Math.log(i) * Math.LOG10E;   ",
"}",
"",
"function ln(i){",
"return Math.log(i);",
"}",
"",
"function sq(i){",
"return i * i;",
"}",
"",
"function sqr(i){",
"return Math.sqrt(i);",
"}",
"",
"",
"function power(x,y){",
"return Math.pow(x,y);",
"}",
"",
"function eTo(x){",
"return Math.exp(x);",
"}",
"",
"",
"function fixDP(r, dps) {",
"if (isNaN(r)) return \"NaN\";",
"var msign = '';",
"if (r < 0) msign = '-';",
"x = Math.abs(r);",
"if (x > Math.pow(10, 21)) return msign + x.toString();",
"var m = Math.round(x * Math.pow(10, dps)).toString();",
"if (dps == 0) return msign + m;",
"while (m.length <= dps) m = \"0\" + m;",
"return msign + m.substring(0, m.length - dps) + \".\" + m.substring(m.length - dps);",
"}",
"",
"var currenttimeout;",
"",
"",
"var calctxt = ''; ",
"var xmltxt = ''; ",
"var htmtxt = ''; ",
"",
"",
"",
"function DLCO_Anemia_fx() {",
"",
"currenttimeout = self.setTimeout('minMaxCheck();', 3000);",
"",
"with(document.DLCO_Anemia_form){",
"",
"",
"doCalc = true;",
"if (Sex_radio[0].checked){ Sex = 'male'; }",
"if (Sex_radio[1].checked){ Sex = 'female';; }",
"if (Age_param.value.indexOf(',') >= 0){ Age_param.value = ''; doCalc = false; alert('Comma character not allowed'); }",
"param_value = parseFloat(Age_param.value);",
"if (isNaN(param_value)){param_value = \"\"; doCalc = false;}",
"Age = param_value;",
"if (Hgb_param.value.indexOf(',') >= 0){ Hgb_param.value = ''; doCalc = false; alert('Comma character not allowed'); }",
"param_value = parseFloat(Hgb_param.value);",
"if (isNaN(param_value)){param_value = \"\"; doCalc = false;}",
"Hgb = param_value;",
"if (DLCO_Predicted_param.value.indexOf(',') >= 0){ DLCO_Predicted_param.value = ''; doCalc = false; alert('Comma character not allowed'); }",
"param_value = parseFloat(DLCO_Predicted_param.value);",
"if (isNaN(param_value)){param_value = \"\"; doCalc = false;}",
"DLCO_Predicted = param_value;",
"dp = decpts.options[decpts.selectedIndex].text;",
"if ((Sex == 'male') && (Age >= 15)){ DLCO_Predicted_Corrected = DLCO_Predicted * (1.7 * Hgb /(10.22 + Hgb));}",
"else{ DLCO_Predicted_Corrected = DLCO_Predicted * (1.7 * Hgb /(9.38 + Hgb));}",
"DLCO_Predicted_Corrected =  DLCO_Predicted_Corrected;",
"",
"if (doCalc) DLCO_Predicted_Corrected_param.value = fixDP(DLCO_Predicted_Corrected, dp);",
"",
"",
"",
"",
"",
"}",
"",
"}",
"",
"function minMaxCheck(){",
"",
"if (currenttimeout) self.clearTimeout(currenttimeout);",
"",
"with(document.DLCO_Anemia_form){",
"",
"if (Age_param.value && Age < 1) {",
"Age = 0;",
"Age_param.value = \"\";",
"clrResults();",
"doCalc = false;",
"alert(\"The minimum value for Age is 1 Years old.\\nIf you are specifying a value with a different unit,\\nchange the unit selector first.\");",
"}",
"if (Age_param.value && Age > 120) {",
"Age_param.value = \"\";",
"clrResults();",
"Age = 0;",
"doCalc = false;",
"alert(\"The maximum value for Age is 120 Years old.\\nIf you are specifying a value with a different unit,\\nchange the unit selector first.\");",
"}",
"if (Hgb_param.value && Hgb < 5) {",
"Hgb = 0;",
"Hgb_param.value = \"\";",
"clrResults();",
"doCalc = false;",
"alert(\"The minimum value for Hgb is 5 g/dL.\\nIf you are specifying a value with a different unit,\\nchange the unit selector first.\");",
"}",
"if (Hgb_param.value && Hgb > 20) {",
"Hgb_param.value = \"\";",
"clrResults();",
"Hgb = 0;",
"doCalc = false;",
"alert(\"The maximum value for Hgb is 20 g/dL.\\nIf you are specifying a value with a different unit,\\nchange the unit selector first.\");",
"}",
"",
"",
"}",
"",
"}",
"",
"",
"function clrResults(){",
"",
"if (currenttimeout) self.clearTimeout(currenttimeout);",
"",
"with(document.DLCO_Anemia_form){",
"",
"DLCO_Predicted_Corrected_param.value = '';",
"",
"",
"}",
"",
"}",
"",
"",
"",
"",
"",
"",
"",
"",
"",
"",
"",
""].join("\n");
