" <div id=\"topicContent\">",
"  <div id=\"topicTitle\">",
"   Pauciarticular onset juvenile idiopathic arthritis",
"  </div>",
"  <div id=\"topicContributors\">",
"   <div>",
"    <a id=\"authors\">",
"    </a>",
"    <a class=\"contributor contributor_credentials contributorType\" href=\"UTD.htm?23/31/24056/contributors\">",
