var title_f23_31_24058="Pulmonary vascular lesions in MCTD";
var content_f23_31_24058=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=RHEUM%2F88300&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=RHEUM%2F88300&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\" style=\"width: 616px\">",
"   <div class=\"ttl\">",
"    Pulmonary vascular lesions in mixed connective tissue disease",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 596px; height: 436px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    Pulmonary vascular lesions in MCTD.",
"    <br>",
"     (Panel A) Severe intimal fibrosis almost occluding the vascular lumen (Elasitica-Goldner stain).",
"     <br>",
"      (Panel B) Organized thrombus in medium-sized artery (Elasitica-Goldner stain).",
"      <br>",
"       (Panel C) Plexogenic arteriopathy sometimes occured (Elasitica-Goldner stain).",
"       <br>",
"        (Panel D) Vasculitis of small vessels with inflammatory infiltration around vessels almost composed of lymphocytes (Elastica-Goldner stain).",
"        <br>",
"         MCTD cases with PH also show the interstitial type, vascular type, and mixed type with both lesions; however, the mixed type is very rare. Further, the vascular type of MCTD shows similar lesions to SSc, such as fibrous thickening, and to SLE, such as plexogenic arteriopathy.",
"         <div class=\"footnotes\">",
"          MCTD: mixed connective tissue disease; PH: pulmonary hypertension; SSc: systemic sclerosis (scleroderma); SLE: systemic lupus erythematosus.",
"         </div>",
"         <div class=\"reference\">",
"          Reproduced with permission from: Sasaki N, Kamataki A, Sawai T. A histopathological study of pulmonary hypertension in connective tissue disease. Allergol Int 2011; 60:411. Copyright &copy; 2013 Japanese Society of Allergology.",
"         </div>",
"        </br>",
"       </br>",
"      </br>",
"     </br>",
"    </br>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
