var title_f23_31_24061="Principles of risk management during opioid treatment for pain";
var content_f23_31_24061=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=ONC%2F50477&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=ONC%2F50477&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=2\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Principles of risk management during opioid treatment for pain",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\">",
"        Goals",
"       </td>",
"       <td class=\"subtitle1\">",
"        Strategies",
"       </td>",
"       <td class=\"subtitle1\">",
"        Comments",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Stratification of risk",
"        </strong>",
"       </td>",
"       <td>",
"        To clarify the likelihood of future aberrant drug-related behavior",
"       </td>",
"       <td>",
"        <p>",
"         <strong>",
"          Regard as high risk if:",
"         </strong>",
"        </p>",
"        <ul>",
"         <li>",
"          History of alcohol or drug misuse",
"         </li>",
"         <li>",
"          Family history of alcohol or drug misuse",
"         </li>",
"         <li>",
"          Major psychiatric disorder",
"         </li>",
"        </ul>",
"        <p>",
"         &nbsp;",
"        </p>",
"        <p>",
"         <strong>",
"          Other factors that suggest risk:",
"         </strong>",
"        </p>",
"        <ul>",
"         <li>",
"          Cancer associated with heavy alcohol use or smoking",
"         </li>",
"         <li>",
"          Current heavy smoking",
"         </li>",
"         <li>",
"          Young age",
"         </li>",
"         <li>",
"          History of automobile accidents, chronic unemployment, poor support system",
"         </li>",
"        </ul>",
"        <p>",
"         &nbsp;",
"        </p>",
"        <p>",
"         <strong>",
"          Factors that can mitigate risk:",
"         </strong>",
"        </p>",
"        <ul>",
"         <li>",
"          Poor performance status",
"         </li>",
"         <li>",
"          Restricted prognosis",
"         </li>",
"         <li>",
"          Active recovery program",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
"        All patients should undergo risk assessment and stratification; although many questionnaires have been developed to predict aberrant behavior or addiction, the clinical assessment is generally used in practice.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         Structuring of treatment commensurate with risk",
"        </strong>",
"       </td>",
"       <td>",
"        Practices to match monitoring with risk, and when needed to help patients maintain control",
"       </td>",
"       <td>",
"        <p>",
"         <strong>",
"          Strategies include:",
"         </strong>",
"        </p>",
"        <ul>",
"         <li>",
"          Use of drug monitoring (eg, urine drug testing)",
"         </li>",
"         <li>",
"          Small amounts prescribed",
"         </li>",
"         <li>",
"          No use of short-acting drugs",
"         </li>",
"         <li>",
"          Use of one pharmacy",
"         </li>",
"         <li>",
"          Pill counts at time of visit",
"         </li>",
"         <li>",
"          Compulsory consultations",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
"        The decision to implement one or more of these strategies is a matter of clinical judgment.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         Assessment of drug-related behaviors over time",
"        </strong>",
"       </td>",
"       <td>",
"        Track drug use in tandem with all relevant outcomes",
"       </td>",
"       <td>",
"        <p>",
"         <strong>",
"          Monitor:",
"         </strong>",
"        </p>",
"        <ul>",
"         <li>",
"          Drug-related behavior - eg, need for early refills, obtaining several prescriptions, etc",
"         </li>",
"         <li>",
"          Pain relief",
"         </li>",
"         <li>",
"          Adverse drug effects",
"         </li>",
"         <li>",
"          Effect of drug on other outcomes",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
"        Broad monitoring of outcomes is consistent with integration of pain management into a palliative care model.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         Response to aberrant drug-related behaviors",
"        </strong>",
"       </td>",
"       <td>",
"        Clinician compliance with laws and regulations; identification of patients needing additional management",
"       </td>",
"       <td>",
"        <p>",
"         <strong>",
"          If the patient engages in aberrant drug-related behavior:",
"         </strong>",
"        </p>",
"        <ul>",
"         <li>",
"          Reassess and diagnose (addiction, other psychiatric disorder, pseudoaddiction, family issues, criminal intent)",
"         </li>",
"         <li>",
"          If diversion into the illicit marketplace is discovered, stop prescribing",
"         </li>",
"         <li>",
"          Otherwise, restructure treatment to improve control and obtain consultative help as needed",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
"        Even advanced illness does not free the clinician from the requirement of compliance with laws and regulations.",
"       </td>",
"      </tr>",
"      <tr class=\"divider_top\">",
"       <td>",
"        <strong>",
"         Documentation and communication",
"        </strong>",
"       </td>",
"       <td>",
"        Risk assessment and management should be viewed as integral to safe and effective prescribing",
"       </td>",
"       <td>",
"        <p>",
"         <strong>",
"          Document:",
"         </strong>",
"        </p>",
"        <ul>",
"         <li>",
"          Plan for monitoring and education of patient and family",
"         </li>",
"         <li>",
"          Monitoring of drug-related behavior on a regular basis",
"         </li>",
"         <li>",
"          Response should aberrant behavior occur",
"         </li>",
"        </ul>",
"       </td>",
"       <td>",
"        Open discussion of the need for universal risk management with other clinicians is valuable to reduce the risk of stigmatizing patients.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"    </div>",
"    <div class=\"reference\">",
"     Reproduced from: Portenoy RK. Treatment of cancer pain. Lancet 2011; 377:2236. Table used with the permission of Elsevier Inc. All rights reserved.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
